import React from "react";

const HomePage = () => (
    <div className='homepage'>
        <div className='directory-menu'>
            <div className='menu-item'>
                <div className='content'>
                    <h1 className='title'> </h1>
                    <span className='subtitle'></span>
                </div>
            </div>
        </div>
    </div>
); 


export default HomePage;
